    "2013-03-16T01:23:00.106336",nt"name": "analytical-results-for-soil-samples-and-plots-of-results-of-r-mode-factor-analysis-of-soil-and-",nt"isopen":
    false,nt"url": null,nt"notes": "Soil samples were collected October 16-19,
    1994, from 189 sites over and near the Dixie Valley Known Geothermal Resource Area
    (KGRA) and along the front of the Stillwater Mountains south of the KGRA in the
    northern Dixie Valley, Nevada. The study was funded by the U.S. Department of Qiergy,
    and was part of a geochemical and biogeochemical survey seeking surficial evidence
    for subsurface features, many of which were already known from drilling, of the
    geothermal reservoir at Dixie Valley.  Sampling and analysis of the soils are described
    and results of analyses are listed.  Plots of percentile values of eight multielement
    factors determined by R-mode factor analysis of soil and soil-gas data are presented,
    these plots show anomalous sites related to geothermal activity, hot spring deposits,
    faults, and other sources in the Dixie Valley.",nt"license_title": null,nt"extras":
